+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="4197637343587238B2F5478413EE9462", NativeString="The shop refresh timer counts down to when the item shop will <text color=\"FFFFFF\" fontface=\"medium\">update</>. Check back to see what's new!\r\nWhen the item shop refreshes, currently available items may <text color=\"FFFFFF\" fontface=\"medium\">rotate</> or <text color=\"FFFFFF\" fontface=\"medium\">leave</>, and new items may be added.", LocalizedStrings=(("ar","يتم تحديث المتجر كل يوم عادة الساعة 3 فجرًا بتوقيت الرياض (حوالي الساعة 7 مساءً بالتوقيت الشرقي للولايات المتحدة).\r\nعندما تتم عملية تحديث عناصر المتجر، قد <text color=\"FFFFFF\" fontface=\"medium\">تستبدل</> العناصر المتاحة حاليًا أو <text color=\"FFFFFF\" fontface=\"medium\">ستزال</> حيث سيتم إضافة عناصر جديدة بدلًا منها. عُد وتفقد ما هو جديد!"),("en","The shop refreshes every day, usually at 7:00 PM ET (which is midnight GMT).\r\nWhen the item shop refreshes, currently available items may <text color=\"FFFFFF\" fontface=\"medium\">rotate</> or <text color=\"FFFFFF\" fontface=\"medium\">leave</>, and new items may be added. Check back to see what's new!"),("de","Der Shop wird jeden Tag aktualisiert, üblicherweise um 1:00 Uhr Morgens (oder Mitternacht in GMT).\r\nWenn der Item-Shop aktualisiert wird, können gegenwärtig verfügbare Items <text color=\"FFFFFF\" fontface=\"medium\">ersetzt</> oder <text color=\"FFFFFF\" fontface=\"medium\">entfernt</> werden, und es können neue Items hinzugefügt werden. Schaue einfach später nochmal vorbei!"),("es","La tienda se actualiza cada día. Esto suele suceder de manera general a la 1:00 CET (medianoche en el huso horario GMT).\r\nCuando la tienda se actualiza, los artículos que están disponibles <text color=\"FFFFFF\" fontface=\"medium\">rotan</> o <text color=\"FFFFFF\" fontface=\"medium\">abandonan</> la tienda. Es posible que se añadan nuevos artículos. ¡Vuelve a la tienda cada día para comprobar las novedades!"),("es-419","La tienda se actualiza todos los días, por lo general a las 21:00 AR / 18:00 MX (medianoche en el huso horario GMT).\r\nCuando la tienda de objetos se actualiza, los objetos disponibles en ese momento podrían <text color=\"FFFFFF\" fontface=\"medium\">actualizarse</> o <text color=\"FFFFFF\" fontface=\"medium\">desaparecer</> para posiblemente añadir objetos nuevos. ¡Vuelve a la tienda cada día para comprobar las novedades!"),("fr","La boutique est actualisée tous les jours, généralement à 1h du matin (CET).\r\nQuand la boutique d'objets est actualisée, certains objets disponibles peuvent être <text color=\"FFFFFF\" fontface=\"medium\">remplacés</> ou <text color=\"FFFFFF\" fontface=\"medium\">retirés</>, tandis que d'autres objets peuvent être ajoutés. Revenez régulièrement voir les nouveautés !"),("it","Il Negozio si aggiorna ogni giorno, solitamente alle 01:00 ora italiana (00:00 GMT).\r\nQuando il Negozio si aggiorna, gli oggetti attualmente disponibili possono <text color=\"FFFFFF\" fontface=\"medium\">ruotare</> o <text color=\"FFFFFF\" fontface=\"medium\">scomparire</>, rimpiazzati da nuovi oggetti. Torna presto per scoprire le novità!"),("ja","ショップは毎日更新され、通常アメリカ米国東部時間の午後7時(日本時間では午前9時)に更新されるぞ。アイテムショップが更新されると、現在入手可能なアイテムが<text color=\"FFFFFF\" fontface=\"medium\">入れ替わる</>か、あるいは<text color=\"FFFFFF\" fontface=\"medium\">配信終了</>し、新しいアイテムが追加される場合があるぞ。後で新アイテムをチェックしにこよう！"),("ko","상점은 보통 매일 오후 7시(미국 동부 시간)에 새로 고침됩니다.\r\n아이템 상점이 새로 고침될 때 현재 판매 중인 아이템이 <text color=\"FFFFFF\" fontface=\"medium\">교체</>되거나 <text color=\"FFFFFF\" fontface=\"medium\">제거</>되고, 새로운 아이템이 추가될 수 있습니다. 다시 돌아와 새로운 콘텐츠를 확인하세요!"),("pl","Odświeżenie sklepu następuje codziennie, zazwyczaj o godz. 1:00 czasu polskiego.\r\nPo odświeżeniu sklepu aktualnie dostępne przedmioty mogą <text color=\"FFFFFF\" fontface=\"medium\">zmienić pozycję</> lub <text color=\"FFFFFF\" fontface=\"medium\">zniknąć</>, mogą też zostać dodane nowe przedmioty. Zaglądajcie, aby sprawdzić, co proponujemy nowego!"),("pt-BR","A Loja é renovada diariamente, geralmente às 21h (BRT) (ou meia-noite GMT).\r\nQuando a Loja de Itens é renovada, há uma <text color=\"FFFFFF\" fontface=\"medium\">rotação</> dos itens disponíveis, ou eles <text color=\"FFFFFF\" fontface=\"medium\">saem</> da Loja, e novos itens podem ser adicionados. Confira a Loja após a renovação para ver as novidades!"),("ru","Магазин обновляется каждый день в 3:00 по московскому времени.\r\nПосле обновления магазина текущие товары могут <text color=\"FFFFFF\" fontface=\"medium\">временно поменяться на другие</> или <text color=\"FFFFFF\" fontface=\"medium\">исчезнуть из продажи</>, а ещё могут появиться новые предметы. Когда ассортимент обновится, загляните, чтобы узнать, что нового появилось!"),("tr","Mağaza her gün TSİ 03.00 sularında yenilenir (GMT ile gece yarısında).\r\nİçerik mağazası yenilendiğinde mevcut olarak alınabilen içerikler <text color=\"FFFFFF\" fontface=\"medium\">değişebilir</> veya <text color=\"FFFFFF\" fontface=\"medium\">kaldırılabilir</> ve yeni eşyalar eklenebilir. Neyin yeni olduğunu görmek için tekrar kontrol et!")))
