+TextReplacements=(Category=Game, Namespace="FortSetting", bIsMinimalPatch=True, Key="AllowDiscoveryPersonalization_Description", NativeString="This setting enables you to receive personalized game experience recommendations when using the Discover tab.\n\n<strong>ON</>: Recommendations you receive in your Discover tab will be personalized.\n\n<strong>OFF</>: Recommendations you receive in your Discover tab will not be personalized.", LocalizedStrings=(("en","This setting enables you to receive personalized game experience recommendations when using the Discover tab. Requires you to restart Fortnite to take effect.\n\n<strong>ON</>: Recommendations you receive in your Discover tab will be personalized.\n\n<strong>OFF</>: Recommendations you receive in your Discover tab will not be personalized."),("de","Durch diese Einstellung kannst du personalisierte Spiel- und Erlebnisempfehlungen erhalten, wenn du den Entdecken-Tab nutzt. Erfordert einen Neustart von Fortnite, um wirksam zu werden.\n\n<strong>AN</>: Empfehlungen im Entdecken-Tab werden personalisiert.\n\n<strong>AUS</>: Empfehlungen im Entdecken-Tab werden nicht personalisiert."),("es","Esta opción te permite recibir recomendaciones personalizadas cuando utilices la pestaña Descubrir. Es necesario reiniciar Fortnite para que surta efecto.\n\n<strong>SÍ</>: Las recomendaciones que recibas en la pestaña Descubrir serán personalizadas.\n\n<strong>NO</>: Las recomendaciones que recibas en la pestaña Descubrir no serán personalizadas."),("es-419","Esta opción te permite recibir recomendaciones personalizadas cuando utilices la pestaña Descubrir. Es necesario reiniciar Fortnite para que se apliquen los cambios.\n\n<strong>SÍ</>: Las recomendaciones que recibas en la pestaña Descubrir serán personalizadas.\n\n<strong>NO</>: Las recomendaciones que recibas en la pestaña Descubrir no serán personalizadas."),("fr","Ce paramètre permet de personnaliser les recommandations d'expériences que vous recevez dans le menu Découvrir. Vous devrez relancer Fortnite pour que vos préférences s'appliquent.\n\n<strong>​Oui</> : les recommandations que vous recevez dans le menu Découvrir sont personnalisées.\n\n<strong>​Non</> : les recommandations que vous recevez dans le menu Découvrir ne sont pas personnalisées."),("it","Questa impostazione ti abilita a ricevere consigli per un'esperienza di gioco personalizzata mentre usi la scheda Scopri. È necessario riavviare Fortnite affinché la tua scelta abbia effetto.\n\n<strong>​SÌ</>: Le esperienze raccomandate nella scheda Scopri saranno personalizzate.\n\n​<strong>​NO</>: Le esperienze raccomandate nella scheda Scopri non saranno personalizzate."),("ja","この設定では、ディスカバリータブの使用時に、個人向けにされたゲームコンテンツのおすすめを受けれるようになります。設定を適用するにはフォートナイトを再起動する必要があります。\n\n<strong>オン</>: ディスカバリータブで受けるおすすめを個人向けにすることができます。\n\n<strong>オフ</>: ディスカバリータブで受けるおすすめは個人向けにされません。"),("ko","디스커버 탭에서 맞춤형 게임 맵 추천을 이용하는 설정입니다. 변경 사항을 적용하려면 포트나이트를 다시 시작해야 합니다.\n\n<strong>켜기</>: 맞춤형 디스커버 탭 추천을 받습니다.\n\n<strong>끄기</>: 맞춤형 디스커버 탭 추천을 받지 않습니다."),("pl","To ustawienie umożliwia otrzymywanie spersonalizowanych rekomendacji dotyczących rozgrywki podczas korzystania z zakładki Odkryć. By zastosować zmiany, należy ponownie uruchomić Fortnite.\n\n​<strong>​WŁ.</>: rekomendacje otrzymywane w zakładce Odkryć będą spersonalizowane.\n\n<strong>​WYŁ.</>: rekomendacje otrzymywane w zakładce Odkryć nie będą spersonalizowane."),("pt-BR","Esta configuração permite que você receba recomendações personalizadas de experiências ao usar o menu Descobrir. Você precisa reiniciar o Fortnite para as mudanças terem efeito.\n\n<strong>​LIGADO</>: as recomendações do menu Descobrir serão personalizadas.\n\n​<strong>​DESLIGADO</>: as recomendações do menu Descobrir não serão personalizadas."),("ru","Данный параметр позволяет получать индивидуальные рекомендации по выбору игр и развлечений в меню «Поиск». Необходимо перезапустить Fortnite, чтобы изменения вступили в силу.\n\n<strong>ВКЛ</>: рекомендации, которые вы получаете в меню «Поиск», будут персонализированы.\n\n<strong>ОТКЛ</>: рекомендации, которые вы получаете в меню «Поиск», не будут персонализированы."),("tr","Bu ayar, Keşfet sekmesini kullanırken kişiselleştirilmiş oyun deneyimi önerileri almanı sağlar. Yaptığın değişikliğin uygulanması için Fornite'ı yeniden başlatman gerekir. \n\n<strong>AÇIK</>: Keşfet sekmesinde aldığın öneriler kişiselleştirilir.\n\n<strong>KAPALI</>: Keşfet sekmesinde aldığın öneriler kişiselleştirilmez."),("ar","يمكّنك هذا الإعداد من تلقي توصيات مخصصة لتجارب الألعاب التي تظهر لك عند استخدام علامة التبويب اكتشف. تشغيل الإعداد يتطلب منك إعادة تشغيل لعبة Fortnite ليصبح نافذ المفعول.\n\n<strong>تشغيل</>: سيتم تخصيص التوصيات التي تتلقاها في علامة التبويب اكتشف.\n\n<strong>إيقاف</>:  لن يتم تخصيص التوصيات التي تتلقاها في علامة التبويب اكتشف.")))
