"),("pt-BR","Escolha um Emoticon​ <text color=\"FFFFFFFF\">ESTÁTICO</> do seu Vestiário para exibir!"),("ru","Показывайте выбранный вами эмодзи из шкафчика, но только <text color=\"FFFFFFFF\">без анимации</>!"),("tr","Dolabından bir <text color=\"FFFFFFFF\">SABİT</> emoji seçerek sergile!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="72F68CF241A603AFFF661AB4DEDFF97E", NativeString="Arriving on the island just in time for ninja justice and maybe a slice of pizza!\r\n\r\nArt by Kevin Eastman.", LocalizedStrings=(("de","Schnell zur Insel für Ninja-Gerechtigkeit ... und vielleicht ein Stück Pizza?\n\nIllustration von Kevin Eastman.")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="7D8945DC4E38D11A7A39629A636BAE94", NativeString="Content involving or promoting illegal activities, including harassment, bullying, assault, doxing, swatting, gambling, illegal drugs, animal cruelty, fraud, hacking, or piracy. Content that condones or incites violence against others.", LocalizedStrings=(("en","We take reports of potentially illegal content seriously. Illegal content includes any content or behavior that breaks the law in any country."),("de","Wir nehmen Meldungen über möglicherweise illegale Inhalte sehr ernst. Illegale Inhalte umfassen jegliches Verhalten oder Inhalte, die in jeglichen Ländern gegen geltendes Recht verstoßen."),("es","Nos tomamos muy en serio los informes sobre posible contenido ilegal. Por contenido ilegal se entiende cualquier contenido o comportamiento que infrinja la ley en cualquier país."),("es-419","Nos tomamos en serio las denuncias sobre posible contenido ilegal. Contenido ilegal se refiere a cualquier contenido o comportamiento que infrinja la ley de cualquier país."),("fr","Nous prenons les signalements de contenu potentiellement illégal très au sérieux. Le contenu illégal comprend tout contenu ou comportement qui enfreint la loi dans n'importe quel pays."),("it","Prendiamo seriamente ogni segnalazione per contenuti illegali. Questo include qualsiasi contenuto o attività che infrange la legge di qualsiasi paese."),("ja","私たちは違法である可能性のあるコンテンツに対する通報を真剣に受け止めています。違法なコンテンツには、いかなる国/地域の法律に違反するコンテンツまたは行為が含まれます。"),("ko","에픽은 불법일 가능성이 있는 콘텐츠에 대한 신고를 심각하게 받아들이고 있습니다. 불법 콘텐츠는 어떤 국가에서든 법을 위반하는 모든 콘텐츠나 행동을 포함합니다."),("pl","Bardzo poważnie traktujemy zgłoszenia treści potencjalnie nielegalnych. Treści nielegalne zawierają treści lub zachowania, które łamią prawo dowolnego państwa."),("pt-BR","Levamos a sério denúncias de conteúdos potencialmente ilegais. Conteúdos ilegais podem incluir qualquer conteúdo ou comportamento que quebre a lei de qualquer país."),("ru","Мы серьёзно относимся к жалобам на потенциально незаконные материалы. Незаконными материалами или противоправным поведением может считаться всё, что нарушает закон любой страны мира."),("tr","Yasadışı içeriklerle ilgili raporlara ciddiyetle yaklaşıyoruz. Herhangi bir ülkede kanunlara aykırı olan herhangi bir içerik veya davranış, yasadışı içeriklere dahildir."),("ar","نأخذ البلاغات عن المحتوى الذي يُحتمل أن يكون غير قانوني على محمل الجد. يشمل المحتوى غير القانوني أي محتوى أو سلوك يخالف القانون في أي دولة.")))
